import { Container } from 'react-bootstrap'

// import Header.js
import Header from './components/Header'
// import Footer.js
import Footer from './components/Footer'
// import HomeScreen.js
import HomeScreen from './components/HomeScreen'

function App() {
  return (
    <div>
      <Header/>
      <main className="py-5">
        <Container>
          <h1>Welcome</h1>
        </Container>
      </main>
      <Footer/>
    </div>
  );
}

export default App;
